import React from 'react';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar'
import styled from 'styled-components';

const Styles = styled.div`
    .navbar {
        background-color: #00004d;
        margin-bottom: 20px;
    }

    .navbar-brand, .navbar-nav, .navbar-link, navbar-collapse {
        color: white;
        font-family: Verdana, Arial, Helvetica, sans-serif;
        font-size: 20px;

        &:hover {
            color: #bbb;
        }
    }
`;

const NavigationBar = () => (
    <Styles>
        <Navbar expand="lg">
            <Navbar.Brand href="/">HOME</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="ml-auto">
                    <Nav.Item><Nav.Link href="/about" style={{color: "white"}}>ABOUT</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href="/projects" style={{color: "white"}}>PROJECTS</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href="/experiences" style={{color: "white"}}>EXPERIENCES</Nav.Link></Nav.Item>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    </Styles>
)

export default NavigationBar;
